using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct DamageAmountComponentResolver : IResolver<DamageAmountComponent>, IResolver<DamageAmountComponentResolver,DamageAmountComponent>, IData	{		public DamageAmountComponentResolver In(ref DamageAmountComponent damageamountcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetDamageAmountComponent();			Out(ref local);		}		public void Out(ref DamageAmountComponent damageamountcomponent)		{		}	}}